  <div id="app">
    <h1>Fundamentos React</h1>

    <Card title="Desafio Aleatório">
    <Random min={1} max={60} />
    </Card>

    <Card title="Fragmento">
          <Fragment />
    </Card>

    <Card title="Com parâmetro">
    <WParams title="Situação do Aluno" aluno="Pedro" nota={9.3} />
